import React,{useState} from "react";
import Select from "react-select";
import Feb22 from "../Charts/feb22";

function MonthData () {
    var MonthList = [
    {
        label: "January 2022",
        "path": "/Jan22"
    },
    {
        "appName": "Febrary 2022",
    }
    ];
    
    const [result, monthvalue] = useState(MonthList.path);
    const monthHandler = e =>
    {
        monthvalue(e.path);
    }
    const [label, monthlabel] = useState(MonthList.label);
    const labelHandler = e => {
        monthlabel(e.label);
    }
    return (
        <div>
            <Select options={MonthList} onChange={event => monthHandler(event) + labelHandler(event)} />
            <h2>{label}</h2>
            <center>
                <h1>{result}</h1>
            </center>
        </div>
    )
}



export default MonthData;
